import React from "react";
import './css/Contact_body.css';

function Contact_body() {
    return(
        <>
            <div className="contact-body">
                <div className="contact-box1"></div>
                <div className="contact-box2"></div>
                <div className="contact-box3"></div>
            </div>
        </>
    );
}
export default Contact_body;
